import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Navbar from '../components/Navbar';

function UpdateProfile() {
  const [profile, setProfile] = useState({
    firstName: '',
    lastName: '',
    dateOfBirth: '',
    gender: '',
    identification: { number: '', type: '', expiration: '', country: '' },
    vehicle: { plateNumber: '', type: '', make: '', model: '', year: '' },
  });

  useEffect(() => {
    // Replace with the actual user ID
    const userId = 1; // This would be dynamic based on the logged-in user
    axios
      .get(`http://localhost:8080/api/v1/user/${userId}`)
      .then((response) => setProfile(response.data))
      .catch((error) => console.error('Error fetching profile:', error));
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    const [parent, child] = name.split('.');
    if (child) {
      setProfile((prev) => ({
        ...prev,
        [parent]: { ...prev[parent], [child]: value },
      }));
    } else {
      setProfile((prev) => ({ ...prev, [name]: value }));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Replace with the actual user ID
    const userId = 1;
    axios
      .put(`http://localhost:8080/api/v1/user/${userId}`, profile)
      .then(() => alert('Profile updated successfully'))
      .catch((error) => console.error('Error updating profile:', error));
  };

  return (
    <div>
      <Navbar />
      <h1>Update Profile</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>First Name:</label>
          <input
            type="text"
            name="firstName"
            value={profile.firstName}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Last Name:</label>
          <input
            type="text"
            name="lastName"
            value={profile.lastName}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Date of Birth:</label>
          <input
            type="date"
            name="dateOfBirth"
            value={profile.dateOfBirth}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Gender:</label>
          <select
            name="gender"
            value={profile.gender}
            onChange={handleChange}
            required
          >
            <option value="">Select</option>
            <option value="M">Male</option>
            <option value="F">Female</option>
          </select>
        </div>
        <h4>Identification</h4>
        <div>
          <label>Number:</label>
          <input
            type="text"
            name="identification.number"
            value={profile.identification?.number || ''}
            onChange={handleChange}
          />
        </div>
        <h4>Vehicle</h4>
        <div>
          <label>Plate Number:</label>
          <input
            type="text"
            name="vehicle.plateNumber"
            value={profile.vehicle?.plateNumber || ''}
            onChange={handleChange}
          />
        </div>
        <button type="submit">Update Profile</button>
      </form>
    </div>
  );
}

export default UpdateProfile;
